response.about:
ДОБАВЛЯЕТЕСЬ В ДРУЗЬЯ?

Хорошо бы при этом сразу написать, откуда я могу вас знать - я мог забыть.

Не добавляю:
- людей, с которыми не знаком в реальной жизни;
- людей, которые не могут четко сформулировать причину, по которой добавляются;
- людей, которые добавляются по причинам, неинтересным мне (например: поболтать, по приложению, просто так);
- людей, ведущих себя неадекватно, а также неграмотно пишущих.

Задать мне вопрос можно личным сообщением. Я отвечаю только на конкретно поставленные вопросы, по возможности развернуто. Если вы получили ответ, который вас не устраивает, скорее всего вы задали не тот вопрос.

Удачи в контакте.
